<div *ngIf="myGid != 0">
  <p *ngFor="let user of usersonline" class="nickName" id="{{user.nickName}}" style="font-size:12px; margin:4px; padding-left:0px;">
    <font style="cursor: pointer;" (click)="ClkOnNickName(user.nickName, user.userid);" color="{{user.nickColor}}">
      <b>{{user.nickName}}</b>
    </font>
  </p>
</div>

<div *ngIf="myGid == 0">
  <p *ngFor="let user of usersonline" class="mickName" id="{{user.nickName}}" style="font-size:12px; margin:4px; padding-left:0px;">
    <font color="{{user.nickColor}}">
      <b>{{user.nickName}}</b>
    </font>
</div>
